import React from "react";
import { Background, NavBar } from "../index";
function GenericMessage() {
  return (
    <>
      <div>
        <h2 className="">Before you proceed, please remember</h2>
        <p>1. You need to log into your social account using the correct credentials. </p>
        <p>2. When you log in, we'll need your permission to access your account data (profile, audience, and content). Don't worry - we won't post, modify, or delete anything. </p>
        <p>3. The account is connected securely through Phyllo. </p>
        <p>4. You can disconnect your account whenever you choose to.</p>
      </div>
    </>
  );
}

export default GenericMessage;
